/* eslint-disable jsx-a11y/anchor-is-valid */
import axios from "axios";
import { useState,useEffect } from "react";

function FileterListItems() {
	const [userInp,setUserInp]=useState('');
	const [apiData,setApiData]=useState([])
	const url='https://jsonplaceholder.typicode.com/todos/'

	useEffect(()=>{
		filterList()
		fetchApi()
	},[userInp])

	const fetchApi=async ()=>{
		try{
			const response=await axios.get(url)	
			setApiData(response.data)
		}
		catch(e){
			console.log("something went wrong");
		}
	}
	
	const filterList=()=>{
		const ol=document.getElementById("myOl")
		const listItems=ol.getElementsByTagName("li");
		for(let i=0;i<listItems.length;i++){
			const listItem=listItems[i].getElementsByTagName("a")[0];
			const upper=listItem.textContent.toLowerCase();
			
			if(upper.indexOf(userInp.toLowerCase())>-1)
				listItems[i].style.display="block";
			else
				listItems[i].style.display="none";
		}
	}

	return (
		<div className="container mt-5">
			<div className="col-5">
				{/*<div>
					{
						apiData.map((ele,index)=>{return <h6 key={index}>{ele.title}</h6>})
					}
				</div>*/}
				<div className="form-floating">
					<input 
						name="uName"
						id="uName"
						className=" form-control"
						type="text"
						value={userInp}
						placeholder="Enter your username"
						onChange={(e) =>setUserInp(e.target.value)}
					/>
					<label for="uName">Enter your username</label>
				</div>
				<ol className="mt-3" id="myOl">
					<li className="my-2 border rounnded rounded-5 py-2 ps-3 bg-light"><a href="" className="text-dark">Rohit sharma</a></li>
					<li className="my-2 border rounnded rounded-5 py-2 ps-3 bg-light"><a href="" className="text-dark">Shubman Gill</a></li>
					<li className="my-2 border rounnded rounded-5 py-2 ps-3 bg-light"><a href="" className="text-dark">Virat Kohli</a></li>
					<li className="my-2 border rounnded rounded-5 py-2 ps-3 bg-light"><a href="" className="text-dark">Shreyas Iyer</a></li>
					<li className="my-2 border rounnded rounded-5 py-2 ps-3 bg-light"><a href="" className="text-dark">Ishan Kishan</a></li>
					<li className="my-2 border rounnded rounded-5 py-2 ps-3 bg-light"><a href="" className="text-dark">Kl Rahul</a></li>
					<li className="my-2 border rounnded rounded-5 py-2 ps-3 bg-light"><a href="" className="text-dark">Ravindra Jadeja</a></li>
					<li className="my-2 border rounnded rounded-5 py-2 ps-3 bg-light"><a href="" className="text-dark">Hardik Pandya</a></li>
					<li className="my-2 border rounnded rounded-5 py-2 ps-3 bg-light"><a href="" className="text-dark">Axar Patel</a></li>
					<li className="my-2 border rounnded rounded-5 py-2 ps-3 bg-light"><a href="" className="text-dark">Kuldeep Yadav</a></li>
					<li className="my-2 border rounnded rounded-5 py-2 ps-3 bg-light"><a href="" className="text-dark">Jasprit Bumrah</a></li>
					<li className="my-2 border rounnded rounded-5 py-2 ps-3 bg-light"><a href="" className="text-dark">Mohmmad Shami</a></li>
					<li className="my-2 border rounnded rounded-5 py-2 ps-3 bg-light"><a href="" className="text-dark">Mohmmad Siraj</a></li>
				</ol>
			</div>
		</div>
	)
}

export default filterListItems
